      out.write("\t\t\t\t\t\t\t\t\t<p>克里斯汀·迪奥（英语：Christian Dior），简称迪奥（Dior），是法国著名时尚消费品牌。亦为全球高级时尚品牌控股公司：LVMH 酩悦轩尼诗路易威登集团的母公司（Moët Hennessy - Louis Vuitton, LVMH Group）路威酩轩集团，是一法国酒业与高价奢侈品制造集团。Dior 握有 LVMH Group 42.38% 的普通股及 59.3% 的表决权。\r\n");
